import Table from "react-bootstrap/Table";
import React,{useEffect, useState} from "react";
import Pagination from 'react-bootstrap/Pagination';

 const TableView=({tableData})=>{
    const [search, setSearch] = useState()
    const [currentPage, setCurrentPage] = useState(1)
    const [perPage, setPerPage] = useState(5);
    const [sorted, setSorted] = useState("ASC")
    // PAGINATION CODE =====
    const lastIndex = currentPage * perPage
    const firstIndex = lastIndex - perPage

    const records = tableData.slice(firstIndex, lastIndex)
    const [filteredData, setFilteredData] = useState(records)

    const newPage = Math.ceil(tableData.length / perPage)
    console.log(newPage, 'newpae')
    const numbers = [...Array(newPage + 1 ).keys()].slice(1)

    // SEARCH METHOD
    const handleSearch = (e)=>{
        setSearch(e?.target?.value?.toLowerCase())
        setCurrentPage(1);
        const filterData = records.filter(value=>{
            return value?.name?.toLowerCase().includes(search?.toLowerCase())
        })
        setFilteredData(filterData)
        // console.log(filterData, '===')

    }
  
    //SORTING METHOD
    const tableHeaders = [
        'Country',
        'Emoji',
        'Capital',
        'Currency'
    ]
    // PAGINATION METHOD
    const prevPage =()=>{
        if(currentPage > 1){
            setCurrentPage(currentPage - 1)
        }
    }
    const NextPage =()=>{
        if(currentPage < newPage){
            setCurrentPage(currentPage + 1)
        }
    }

    useEffect(()=>{
        // setFilteredData(records)
    },[])

    console.log(filteredData, '===')

    return (
        <>
            <div>
                <form className="col-md-10">
                    <div className="row">
                        <div className="col-md-6 d-flex align-items-center">
                            <label className="form-label me-2 fw-bold">Search</label>
                            <input type="text" className="form-control" value={search || ""} name='search' onChange={handleSearch} />
                        </div>
                    </div>
                </form>
            </div>
            <Table striped bordered hover>
                <thead>
                <tr>
                    {tableHeaders.map(thData=>{
                        return  <th  onClick={()=>handleSortingMethod(thData)}>{thData}
                        {sorted === "Default" ? ' ' :  sorted === "ASC" ? "ðŸ”¼" 
                        : 'ðŸ”½'}
                        </th>
                    })}
                   
                </tr>
                </thead>
                <tbody>
                {filteredData.map((data) => {
                    return (
                    <tr>
                        <td>{data.name}</td>
                        <td>{data.emoji}</td>
                        <td>{data.capital}</td>
                        <td>{data.currency}</td>
                    </tr>
                    );
                })}
                </tbody>
            </Table>
            <Pagination>
                <Pagination.Prev onClick={prevPage}/>
                {numbers.map(num=>{
                        return  <Pagination.Item onClick={()=> setCurrentPage(num)} className={currentPage === num ? "active" : ''}>{num}</Pagination.Item>
                    })}
                <Pagination.Next onClick={NextPage}/>
            </Pagination>
        </>
        )
 }


 export default TableView
